import React, { Component } from 'react';

class Second extends Component {
    constructor(props) {
        super(props)

        this.state = {
             massage:"navid"
        }
    }


    hendal = () => {
        this.setState({
            massage:"mansuri"
        })
        console.log(this);
    }

    render() {
        return (
            <div>
                <h1>{this.state.massage}</h1>
                <button onClick={this.hendal.bind(this)}>on click</button>
                <button onClick={() => this.hendal()}>on click</button>

            </div>
        );
    }
}

export default Second;
